import React, {Component} from 'react';
import axios from 'axios'
import './Chatbox.css';

class Chatbox extends Component {
    constructor(props){
        super(props)
        this.state = {
        };
    }
    async componentDidMount() {
        var options = {
            method: 'POST',
            url: 'https://api.infermedica.com/v2/diagnosis',
            data: {
                information: {
                    sex: "male",
                    age: 30,
                    evidence: {
                        "sex": "male",
                        "age": {
                        "value": 30
                        },
                        "evidence": [
                        {
                            "id": "s_1193",
                            "choice_id": "present",
                            "source": "initial"
                        },
                        {
                            "id": "s_488",
                            "choice_id": "present"
                        },
                        {
                            "id": "s_418",
                            "choice_id": "present"
                        }
                        ]
                    }
                },
                appId: 'aa2fb846',
                appKey: ''
            }
          };

          await axios.request(options).then(function (response) {
              console.log(response.data.conditions);
              console.log('hi')
          }).catch(function (error) {
              console.error(error);
          });
    }
    render() {
        return (
            <div className='Chatbox'>
                <h1 className='Chatbox-Title'>Chatbox</h1>
                <div className='Chatbox-Content'>
                </div>
            </div>
        );
    }
}

export default Chatbox;
